import React from 'react';

const ReviewBalanceSheet = (balanceSheet, onClickHandler) => {
  return (
    <div className='balance-sheet-container'>
        <table>
          <thead>
            <tr>
              <th>Year</th>
              <th>Month</th>
              <th>Assets Value</th>
              <th>Profit/Loss</th>
            </tr>
          </thead>
          <tbody>
            {balanceSheet.map(data => (
              <tr>
                <td>{data.year}</td>
                <td>{data.month}</td>
                <td>{data.assetsValue}</td>
                <td>{data.profitOrLoss}</td>
              </tr>
            ))}
          </tbody>
        </table>
        <button onClick={onClickHandler}>Submit Loan</button>
    </div>
  );
};
export default ReviewBalanceSheet;
